// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract FlightDelayInsurance is Ownable, ReentrancyGuard {
    // Structs
    struct Policy {
        address policyholder;
        string flightIata;
        uint256 premium;
        uint256 purchaseDate;
        uint256 flightDate;
        bool claimed;
        bool isDelayed;
    }

    // Mapping to store policies
    mapping(bytes32 => Policy) public policies;
    mapping(address => bytes32[]) public userPolicies;

    // Insurance pool and parameters
    uint256 public totalPoolFunds;
    uint256 public totalClaimedFunds;
    uint256 public totalPoliciesSold;
    uint256 public constant MIN_DELAY_MINUTES = 120; // 2 hours
    uint256 public constant PAYOUT_PERCENTAGE = 90; // 90% of premium as payout

    // DecentraFlight API endpoint
    string public constant API_BASE_URL = "https://decentraflightapi.onrender.com";

    // Admin wallet
    address public immutable ADMIN_WALLET;

    // Events
    event PolicyPurchased(
        bytes32 policyId, 
        address policyholder, 
        string flightIata, 
        uint256 premium
    );
    event PolicyClaimed(
        bytes32 policyId, 
        address policyholder, 
        uint256 payoutAmount
    );
    event FlightStatusChecked(
        bytes32 policyId, 
        string flightIata, 
        bool isDelayed,
        uint256 delayMinutes
    );
    event FundsWithdrawn(
        address indexed admin, 
        uint256 amount, 
        uint256 timestamp
    );

    constructor() Ownable(msg.sender) {
        ADMIN_WALLET = 0xFdf1e07aaD59183Dfd4Ba2B52B2af903453f7368;
        transferOwnership(ADMIN_WALLET);
    }

    // Purchase insurance policy
    function purchasePolicy(
        string memory flightIata, 
        uint256 flightDate
    ) external payable nonReentrant {
        require(msg.value > 0, "Premium must be greater than 0");
        require(flightDate > block.timestamp, "Flight date must be in the future");

        // Generate unique policy ID
        bytes32 policyId = keccak256(abi.encodePacked(
            msg.sender, 
            flightIata, 
            flightDate, 
            block.timestamp
        ));

        // Create policy
        policies[policyId] = Policy({
            policyholder: msg.sender,
            flightIata: flightIata,
            premium: msg.value,
            purchaseDate: block.timestamp,
            flightDate: flightDate,
            claimed: false,
            isDelayed: false
        });

        // Track user's policies
        userPolicies[msg.sender].push(policyId);

        // Add to pool and increment policies sold
        totalPoolFunds += msg.value;
        totalPoliciesSold++;

        emit PolicyPurchased(policyId, msg.sender, flightIata, msg.value);
    }

    // External function to check flight status
    function checkFlightStatus(bytes32 policyId) external nonReentrant {
        Policy storage policy = policies[policyId];
        require(!policy.claimed, "Policy already claimed");
        require(block.timestamp >= policy.flightDate, "Flight date not reached");

        // Call DecentraFlight API to check flight delay
        (bool isDelayed, uint256 delayMinutes) = _checkDelayViaDecentraFlightAPI(
            policy.flightIata, 
            policy.flightDate
        );
        
        policy.isDelayed = isDelayed;

        emit FlightStatusChecked(policyId, policy.flightIata, isDelayed, delayMinutes);

        // Process claim if delayed
        if (isDelayed) {
            _processClaim(policyId);
        }
    }

    // Internal method to check flight delay via DecentraFlight API
    function _checkDelayViaDecentraFlightAPI(
        string memory flightIata, 
        uint256 flightDate
    ) internal view returns (bool, uint256) {
        // Simulate checking against 2-hour delay threshold
        // In real implementation, this would parse actual API response
        return (true, 150); // Simulated 2.5-hour delay
    }

    // Process claim for delayed flight
    function _processClaim(bytes32 policyId) internal {
        Policy storage policy = policies[policyId];
        require(!policy.claimed, "Policy already claimed");
        require(policy.isDelayed, "Flight not delayed");

        // Calculate payout (90% of premium)
        uint256 payoutAmount = (policy.premium * PAYOUT_PERCENTAGE) / 100;

        // Mark as claimed
        policy.claimed = true;

        // Reduce pool funds and track claimed funds
        totalPoolFunds -= policy.premium;
        totalClaimedFunds += payoutAmount;

        // Transfer payout to policyholder
        (bool success, ) = policy.policyholder.call{value: payoutAmount}("");
        require(success, "Payout transfer failed");

        emit PolicyClaimed(policyId, policy.policyholder, payoutAmount);
    }

    // Admin function to withdraw excess funds
    function withdrawExcessFunds(uint256 amount) external nonReentrant {
        // Ensure only admin can withdraw
        require(msg.sender == ADMIN_WALLET, "Only admin can withdraw");

        // Calculate total balance and pool funds
        uint256 contractBalance = address(this).balance;
        
        // Ensure withdrawal doesn't touch active insurance pool
        require(
            amount <= contractBalance - totalPoolFunds, 
            "Cannot withdraw from insurance pool"
        );

        // Transfer funds to admin
        (bool success, ) = ADMIN_WALLET.call{value: amount}("");
        require(success, "Withdrawal transfer failed");

        emit FundsWithdrawn(ADMIN_WALLET, amount, block.timestamp);
    }

    // Admin function to check contract health
    function getContractStats() external view returns (
        uint256 totalBalance,
        uint256 availablePoolFunds,
        uint256 claimedFunds,
        uint256 policiesSold
    ) {
        return (
            address(this).balance,
            totalPoolFunds,
            totalClaimedFunds,
            totalPoliciesSold
        );
    }

    // Retrieve user's policies
    function getUserPolicies(address user) external view returns (bytes32[] memory) {
        return userPolicies[user];
    }

    // Get policy details
    function getPolicyDetails(bytes32 policyId) external view returns (Policy memory) {
        return policies[policyId];
    }

    // Fallback to receive funds
    receive() external payable {
        totalPoolFunds += msg.value;
    }
}

